import React from "react";

const Picture = ({ data }) => {
  return (
    <div className="picture">
      {/* <div className="imageContainer">
        <img src={data.src.large} alt="img" />
      </div> */}
      <Card bg={'Warning'}>
        <Card.Img variant="top" src={data.src.large} style = {{width :'100%'}}/>
        <Card.Body>
          <Card.Text>
            {data.alt}
          </Card.Text>
        </Card.Body>
      </Card>

    </div>
  );
};

export default Picture;
